import React from 'react';
import { Link } from 'react-router-dom';
import '../css/styles.css';

const SocialLogin = () => {
    return (
        <div className="centered">
            <Link to="/" className="logo">
                <img src="/images/wso2-logo.webp" alt="Logo" width="100" />
            </Link>
            <h2>Social Login Authentication Demo</h2>
            <a className="mockbutton" href="path/to/google/auth">Google</a>
            <a className="mockbutton" href="path/to/apple/auth">Apple</a>
            <a className="mockbutton" href="path/to/microsoft/auth">Microsoft</a>
        </div>
    );
};

export default SocialLogin;
